message:
Uma lei que tramita no Congresso e foi elaborada por Renan Calheiros, indiciado por corrupção em 2021, determina punições em nome da defesa da democracia, sob pena de multa e PRISÃO, nos seguintes principais pontos:

• Penalidades por discriminação política (ofender ou reclamar de um político na frente dele);

• Intolerância, violência e insulto político (a considerar de acordo com o Ministério Público que analisa o caso);

• Obstrução da via pública durante as manifestações.
